({
start: async function(pageId, refreshFlag){
       try{
            if(refreshFlag === '0') {
            if(pageId === window.location.hash.slice(1)) {
                return;
            }
        }
	changeSelectedPageFromSidebar(pageId);

	await webSkel.changeToDynamicPage(pageId, `${webSkel.currentUser.space.id}/SpaceConfiguration/${pageId}`);

        this.return(pageId);
        }catch(e){
            this.fail(e);
            }
    }
})
